import "../card.css"
import img1 from "../images/account.svg"

export default function Card() {
  return (
    <div className='card'>
      <img src={img1} alt="" />
      <div className='part1'>
        <>
          <span>Copany</span> <span>New</span> <span>FEATURED</span>
        </>



        <h4>position</h4>
        <span>postedAt</span> <span>contract</span> <span>location</span>
      </div>


    </div>
  );
}
